import logo from './logo.svg';
import React, { useState } from 'react';
import './App.css';

function App() {

  const [prefrences, setPreferences] = useState({
    beds: '',
    price: '',
    livings: '',
    wc: '',
    area: '',
    ketchen: '',
    furnished: '',
    city: '',
    district: '',
    width: '',
    length: ''
  })

  const handleChange = (e) => {
    const {name, value} = e.target;
    setPreferences({ ...prefrences, [name]: value});
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Placeholder for where we'll send the data
    console.log(prefrences);
  }
}

export default App;
